import React, { Component } from 'react';

export default class Home extends Component {
    render() {
        return (
            <div>
                <h1>Welcome {this.props.name}</h1>
                <ul>
                {
                    this.props.pokemons.map((pokemon)=>{
                        <li>
                            {pokemon.name}
                        </li>
                    })
                }
                </ul>
            </div>
        )
    }
}
